 --> <header class="business-header"> <div class="container"> <div class="row"> <div class="col-lg-12"> <h1 class="tagline">SmartScale</h1> <h2 class="tagline">The only way to track your results</h2> </div> </div> </div> </header> <!-- Page Content --> <div class="container"> <br> <div class="row"> <div class="col-sm-8"> <h2>What We Do</h2> <p>SmartScale is a scale app designed for the fitness industry. SmartScale reads in your weight, body fat composition and water weight and tracks your progress using easy to read graphs.</p> <p>By simply weighing yourself and entering in these pieces of information you can track your progress over time. Never again wonder if your diet or weightlifting program is getting the job done. Hold it accountable by tracking your results daily.</p> <br> <p>Have an Android phone?<br>Try out our mobile app and take SmartScale with you where ever you go.</p> <p> <a href="https://play.google.com/store/apps/details?id=com.art.smartScale"> <img alt="Android app on Google Play" src="https://developer.android.com/images/brand/en_app_rgb_wo_60.png"> </a> </p> </div> <div class="col-sm-4"> <h2>Contact Us</h2> <address> <strong>SmartScale Inc.</strong> <br>Shoreline, WA 98155 <br><a href="mailto:SmartScaleFeedback@gmail.com">SmartScaleFeedback@gmail.com</a> </address> </div> </div> <!-- /.row --> <hr> <div class="row"> <div class="col-sm-4"> <img class="img-circle img-responsive img-center img-border" src="images/graph.c94eb39a.png" alt="Graphs"> <h2>Graphs</h2> <p>Watch your progress with beautiful and enriching graphs. With each weigh in you instantly see where you stand compared to your previous entries. </p> </div> <div class="col-sm-4"> <img class="img-responsive img-center" src="images/fit_512x512.a6fb394d.png" alt="Google Fit"> <h2>Google Fit</h2> <p>Because SmartScale is fully integrated with Google Fit all of your fitness data will be easily accessible by all of your connected devices. Simply enter in your data here and let us sync up everything with the cloud. </p> </div> <div class="col-sm-4"> <img class="img-circle img-responsive img-center" src="images/dumbbells.20388600.jpg" alt="Dumbbells"> <h2>Simple</h2> <p>You spend less time wondering if your hard work is paying off. Let SmartScale manage all your body composition data so you can spend more time enjoying your workouts. </p> </div> </div> <!-- /.row --> <hr> <!-- Footer --> <footer> <div class="row"> <div class="col-lg-12"> <p>Copyright &copy; SmartScale Inc. 2015</p> </div> </div> <!-- /.row --> </footer> </div> <!-- /.container --> <!-- endStuff --> </md-content> </div>')}]);